import React, { useState } from 'react';

import ChatPage from './pages/chat-page.jsx';
import SettingsPage from './pages/settings-page.jsx';
import AccessPage from './pages/access-page.jsx';

function App(){
  const [ currentPage, setCurrentPage ]= useState(displayPage);

  const changePage= (page)=>{
    setCurrentPage(page);
  }

  return (<div>
    {(currentPage === 'ChatPage')&& <ChatPage changePage= {changePage} />}
    {(currentPage === 'AccessPage')&& <AccessPage changePage= {changePage} />}
    {(currentPage === 'SettingsPage')&& <SettingsPage changePage= {changePage} />}
  </div>);
}
export default App;
